import calculate
import unittest
from calendar import isleap

class TestCalculate(unittest.TestCase):
    def test_judge_leap_year(self):
        # Test case for a leap year
        self.assertEqual(calculate.judge_leap_year(2000), isleap(2000))

        # Test case for a non-leap year
        self.assertEqual(calculate.judge_leap_year(2001), isleap(2001))

        # Test case for a year which is not a leap year even though it is divisible by 4
        self.assertEqual(calculate.judge_leap_year(1900), isleap(1900))

        # Test case for a year which is a leap year as it is divisible by 4 and not divisible by 100
        self.assertEqual(calculate.judge_leap_year(2020), isleap(2020))

if __name__ == '__main__':
    unittest.main()
